import React, { Component } from "react";
import "./style.css";
import "..entrada/index.js"

class Saida extends Component {

  constructor(props){
    super(props)
    this.state = {
      texto:{texto}
    }
  }
  HandleChecked(evento){
    console.log(evento.value)
  }

  HandleDelete(evento){
    console.log(evento.value)
  }


  render() {
    return (
      <section className="saida-container">
        <div className="saida-wrap">
          <ul className="saida-lista">
            <li className="saida-item">
              <div>
                <input className="saida-checkbox" type="checkbox" onClick={this.HandleChecked.bind(this)}/>
                <span className="saida-texto">{this.state.texto}</span>
              </div>
              <div>
                <button className="saida-deletar" type="button" onClick={this.HandleDelete.bind(this)}>
                  deletar
                </button>
              </div>
            </li>
            <li className="saida-item">
              <div>
                <input className="saida-checkbox" type="checkbox" />
                <span className="saida-texto">Will puta exemplo</span>
              </div>
              <div>
                <button className="saida-deletar" type="button">
                  deletar
                </button>
              </div>
            </li>
            <li className="saida-item">
              <div>
                <input className="saida-checkbox" type="checkbox" />
                <span className="saida-texto">Will puta exemplo</span>
              </div>
              <div>
                <button className="saida-deletar" type="button">
                  deletar
                </button>
              </div>
            </li>
          </ul>
        </div>
      </section>
    );
  }
}

export default Saida;
